[{"location":"","page":"Home","title":"Home","text":"CurrentModule = FETI","category":"page"},{"location":"#FETI","page":"Home","title":"FETI","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"Documentation for FETI.","category":"page"},{"location":"","page":"Home","title":"Home","text":"","category":"page"},{"location":"","page":"Home","title":"Home","text":"Modules = [FETI]","category":"page"},{"location":"#FETI.DirichletPreconditioner","page":"Home","title":"FETI.DirichletPreconditioner","text":"struct DirichletPreconditioner <: Preconditioner\n\nDirichlet preconditioner that uses a Schur-complement to precondition the  interface problem. This is the most accurate but also most expensive  preconditioner.\n\nThe exact definition for the preconditioner D_I^-1 for N_s  subdomains is given below for interior dofs i, interface dofs b,  subdomain s, interface I, and connectivity operator B\n\nD_I^-1 = sum_s=1^N_s B^s leftbeginarrayc 0  0  0  S_bb^s endarrayright B^s^T\n\nwhere the Schur complement S_bb^s = K_bb^s - K_ib^s^TK_ii^s^-1K_ib^s.\n\nReferences\n\n[1] : Equation (38) and (43) from Farhat, C., Mandel, J., and Roux, F.X. Optimal  convergence properties of the FETI domain decomposition method. Computer Methods  in Applied Mechanics and Engineering. vol 115, 365-385. 1994.\n\n\n\n\n\n","category":"type"},{"location":"#FETI.LumpedPreconditioner","page":"Home","title":"FETI.LumpedPreconditioner","text":"struct LumpedPreconditioner <: Preconditioner\n\nPreconditions the dual-interface problem with an economical preconditioner only involving the the stiffness matrix K_j^I for a subdomain j at the interface I.\n\nThe exact definition for the preconditioner L_I^-1for N_s subdomains  is given below for interface dofs b, subdomain s, and connectivity  operator B\n\nL_I^-1 = sum_s=1^N_s B^s leftbeginarrayc 0  0  0  K_bb^s endarrayright B^s^T\n\nReferences\n\n[1] : Equation (44) from Farhat, C., Mandel, J., and Roux, F.X. Optimal  convergence properties of the FETI domain decomposition method. Computer Methods  in Applied Mechanics and Engineering. vol 115, 365-385. 1994.\n\n\n\n\n\n","category":"type"},{"location":"#FETI.TracePreconditioner","page":"Home","title":"FETI.TracePreconditioner","text":"struct TracePreconditioner <: Preconditioner\n\nSimple preconditioner for the interface problem. Uses the sum of the trace  tr(cdot) of local stiffness matrices K_bb^s on the interface  I with interface dofs denoted by b and subdomains by s for N_s  subdomains.\n\nP_I^-1 = sum_s=1^N_s tr(K_bb^s)\n\nReferences\n\n[1] : Equation (24) from Farhat, C. A Method of Finite Element Tearing and  Interconnecting and its Parallel Solution Algorithm. International Journal for  Numerical Methods in Engineering. vol 32, 1205-1227. 1991. \n\n\n\n\n\n","category":"type"}]
